In spring 2013, ahead of her parents two-week visit, Dawn decided that a makeover was in order. She incorporated color and pattern, yielding an interior more in line with what one might expect in a beach town in Southern California: sun-kissed yellow walls; a swath of Kelly green in the kitchen; a long table, topped with a vibrant print, that functions for reading, dining, or doing work; a lime-hued bathroom; and cheery polka-dotted bedding. But its easy to see why guests are often charmed before ever setting foot inside: Just beyond the blue-and-white cottage-like structures Dutch door is a deck with a view of a pond and a garden that includes a Meyer lemon tree.

&nbsp;

After her parents stay, Dawn thought to herself: Well, Ive got this room thats completely remodeled. What should I do with it? She approached her husband about putting it on WP Rentals. He was hesitant at first; in part because in order to get to the guesthouse, you have to walk right by the couples own residence. So they started out with just single (one-person) bookings before allowing pairs. Now hes a bigger social person with my guests than me, laughs Dawn.
